description:
The Jawaharlal Nehru National Solar Mission was launched on the 11th January, 2010 by the Prime Minister. The Mission which has set the ambitious target of deploying 20,000 MW of grid connected solar power by 2022 is aimed at reducing the cost of solar power generation in the country through 
(i) long term policy; 
(ii) large scale deployment goals; 
(iii) aggressive R&D; and 
(iv) domestic production of critical raw materials, components and products, as a result to achieve grid tariff parity by 2022. 

After successful completion of Phase-I of this mission, Union Minister for Renewable Energy Farooq Abdullah said a target of 10,000 MW solar energy production has been set up for the second phase which will be completed in 2017.
